import { makeStyles } from "@material-ui/core/styles";

export default makeStyles(() => ({
	intro: {
		display: "flex",
		alignItems: "center",
		margin: "6rem 0 2rem 0",
		height: "70vh",
	},
	info: {
		paddingLeft: "2rem",
	},
	about: {
		lineHeight: "25px",
	},
	profileImg: {
		borderRadius: "10%",
	},
	highlights: {
		backgroundColor: "#f39c12",
		padding: "5px",
	},
	paper: {
		display: "flex",
		margin: "2rem 0",
	},
	details: {
		paddingLeft: "4rem",
	},
	title: {
		textAlign: "center",
	},
	projectImage: {
		height: "100%",
	},
}));
